logger = logging.getLogger(__name__)

def generate_guid():
    return str(uuid.uuid4())

class DB:

    def __init__(self, db_name=None):

        self.mongo = None

        if db_name is None:    
            db_name = 'FactorDBv2'

        logger.info("Initialising DB '{}'".format(db_name))

        mongo_path = 'mongo:27017'

        for attempts in range(0,3):
            try:
                dbclient = pymongo.MongoClient(mongo_path, connect=False)
            except:
                dbclient = None
                sleep_time = 3
                logger.warning("Failed to initialise dbclient - will retry in {} seconds".format(sleep_time))
                sleep(sleep_time)
            else:
                break

        # Final attempt
        if dbclient is None:
            try:
                dbclient = pymongo.MongoClient(mongo_path, connect=False)
            except Exception as e:
                logger.exception("Failed to initialise dbclient using path '{}'".format(mongo_path))
                raise

        if db_name not in dbclient.database_names():
            logger.info("Creating db '{}'...".format(db_name))
        else:
            logger.info("db '{}' already exists".format(db_name))    

        self.mongo = dbclient[db_name]

        # Create indexes
        self._create_indexes()

        # Initialise reference data
        self._init_reference_data()

        logger.info("Successfully initialised db")

