    def update_dataset_metadata(self, data):
        query = { 'ID': data['ID'] }
        doc = { key: val for key, val in data.items() if key != 'ID' }
        self.mongo['Datasets'].update_one(query, { '$set': doc }, upsert=False)

    def set_dataset_data(self, dataset_id, filename, dates, stocks, factors, returns_df, factors_df):

        data_info = { 
            'DatasetID': dataset_id,
            'Created': datetime.datetime.utcnow(),
            'Filename': filename,
            'Dates': dates,
            'Stocks': stocks,
            'Factors': factors,
        }
        self.mongo['DatasetDataInfo'].replace_one({ 'DatasetID': dataset_id }, data_info, upsert=True)

        self.mongo['DatasetReturnsData'].replace_one(
            { 'DatasetID': dataset_id },
            { 'DatasetID': dataset_id, 'Data': returns_df.values.tolist() },
            upsert=True)

        self.mongo['DatasetFactorData'].delete_many({'DatasetID': dataset_id})
        for factor_index in range(0, len(factors)):
            self.mongo['DatasetFactorData'].replace_one(
                { 'DatasetID': dataset_id, 'FactorIndex': factor_index },
                { 'DatasetID': dataset_id, 'FactorIndex': factor_index, 'Data': factors_df.loc[factor_index].values.tolist() },
                upsert=True)

    def get_dataset_data_info(self, dataset_id):
        return self.mongo['DatasetDataInfo'].find_one({'DatasetID': dataset_id})

    def get_dataset_data(self, dataset_id, dates, factor_indexes=None):
        
        dates_index = pd.DatetimeIndex(dates)
        
        returns_df = pd.DataFrame(
            index=dates_index,
            data=self.mongo['DatasetReturnsData'].find_one({ 'DatasetID': dataset_id }).get('Data'))

        factor_dfs = {}
        if (factor_indexes is None) or (len(factor_indexes) > 0):
            query = { 'DatasetID': dataset_id }
            if factor_indexes is not None:
                query['FactorIndex'] = { '$in': factor_indexes }

            for doc in self.mongo['DatasetFactorData'].find(query):
                factor_dfs[doc['FactorIndex']] = pd.DataFrame(index=dates_index, data=doc['Data'])

        return { 'Returns': returns_df, 'Factors': factor_dfs }

