    def clone_project(self, existing_project_id):

        project = self.mongo.Projects.find_one({'ID': existing_project_id})
        if project is None:
            return None

        project.pop('_id')
        project['ID'] = generate_guid()
        project['Created'] = datetime.datetime.utcnow()
        project['Name'] += ' (Copy)'
        self.mongo.Projects.insert_one(project)

        for coll in ['ProjectSettings', 'ProjectStocksDisabledStatus', 'ProjectStocksForwardMonthDisabledStatus', 'ProjectFactorsDisabledStatus']:
            doc = self.mongo[coll].find_one({'ProjectID': existing_project_id})
            if doc is not None:
                doc.pop('_id')
                doc['ProjectID'] = project['ID']
                self.mongo[coll].insert_one(doc)

        return self.get_project(project['ID'])

