    def clear_project_data(self, project_id, retain_settings=True):

        self.clear_project_run_data(project_id)

        if not retain_settings:
            self.mongo['ProjectSettings'].delete_one({'ProjectID': project_id})
            self.mongo['ProjectStocksDisabledStatus'].delete_one({'ProjectID': project_id})
            self.mongo['ProjectStocksForwardMonthDisabledStatus'].delete_one({'ProjectID': project_id})
            self.mongo['ProjectFactorsDisabledStatus'].delete_one({'ProjectID': project_id})

    def get_project_data_info(self, project_id):

        project = self.get_project(project_id)
        if project is None:
            return None

        if len(project.get('DatasetIDs', [])) == 0:
            return None

        data_info_list = list(self.mongo['DatasetDataInfo'].find({'DatasetID': { '$in': project['DatasetIDs']} }))
        if len(data_info_list) != len(project['DatasetIDs']):
            return None

        # Dates
        combined_dates = data_info_list[0]['Dates']
        for data_info in data_info_list[1:]:
            if (data_info['Dates'][0] < combined_dates[0]) or (data_info['Dates'][-1] > combined_dates[-1]):
                combined_dates = sorted(list(set(combined_dates + data_info['Dates'])))

        # Stocks
        new_stocks = []
        for data_info in data_info_list:
            dataset_id = data_info['DatasetID']
            for i, stock in enumerate(data_info['Stocks']):
                stock['DatasetID'] = dataset_id
                stock['DatasetIndex'] = i
                new_stocks.append(stock)

        # Factors
        new_factors = data_info_list[0]['Factors']
        factor_mappings_list = [{ i: i for i, f in enumerate(data_info_list[0]['Factors']) }]

        for data_info in data_info_list[1:]:
            factor_mappings = {}
            for pos, f in enumerate(data_info['Factors']):
                try:
                    new_pos = new_factors.index(f)
                except:
                    new_factors.append(f)
                    factor_mappings[len(new_factors)-1] = pos
                else:
                    factor_mappings[new_pos] = pos
            factor_mappings_list.append(factor_mappings)

        for i, data_info in enumerate(data_info_list):
            data_info['FactorMappings'] = factor_mappings_list[i]

        try:
            market_cap_factor_index = new_factors.index("F7")
        except:
            market_cap_factor_index = None

        combined_data_info = { 
            'Dates': combined_dates,
            'Stocks': new_stocks,
            'Factors': new_factors,
            'DatasetDataInfo': data_info_list,
            'MarketCapFactorIndex': market_cap_factor_index,
        }

        return combined_data_info

    def get_project_data(self, project_id, data_info, factor_indexes=None):

        # Load data
        data_list = []
        for i, dataset_data_info in enumerate(data_info['DatasetDataInfo']):
            dataset_factor_indexes = None
            if factor_indexes is not None:
                dataset_factor_indexes = []
                if len(factor_indexes) > 0:
                    for f in factor_indexes:
                        mapped_f = dataset_data_info['FactorMappings'].get(f)
                        if mapped_f is not None:
                            dataset_factor_indexes.append(mapped_f)
            data_list.append(self.get_dataset_data(dataset_data_info['DatasetID'], dataset_data_info['Dates'], dataset_factor_indexes))

        # Returns data
        returns = [data['Returns'] for data in data_list]
        returns = pd.concat(returns, axis=1)
        returns.columns = list(range(0, len(data_info['Stocks'])))

        # Factor data
        factor_dfs = {}

        if factor_indexes is None:
            factor_indexes = list(range(0, len(data_info['Factors'])))

        for f in factor_indexes:
            factor_data = []
            for i, dataset_data_info in enumerate(data_info['DatasetDataInfo']):
                factor_pos = dataset_data_info['FactorMappings'].get(f)
                if factor_pos is None:
                    df = data_list[i]['Returns'] * np.nan
                else:
                    df = data_list[i]['Factors'][factor_pos]
                factor_data.append(df)
            factor_data = pd.concat(factor_data, axis=1)
            factor_data.columns = returns.columns

            factor_dfs[f] = factor_data

        return { 'Returns': returns, 'Factors': factor_dfs }

