    def get_project_factor_clusters(self, project_id, target_month=None):

        def doc_to_df(doc):
            if doc is None:
                return None
            df = pd.Series(index=doc['Factors'], data=doc['Clusters']).to_frame('Cluster')
            df.index.name = 'Factor'
            return df

        if target_month is not None:
            doc = self.mongo['ProjectFactorClusters'].find_one({ 'ProjectID': project_id, 'TargetMonth': target_month })
            return doc_to_df(doc)
        else:
            results = []
            for doc in self.mongo['ProjectFactorClusters'].find({ 'ProjectID': project_id }).sort('TargetMonth', pymongo.ASCENDING):
                results.append({ 'TargetMonth': doc['TargetMonth'], 'Clusters': doc_to_df(doc) })
            return results

