    def add_project_factor_combinations(self, project_id, target_month, context, combinations):

        self.mongo['ProjectFactorCombinations'].insert_one({
             'ProjectID': project_id,
             'Timestamp': datetime.datetime.utcnow(),
             'TargetMonth': target_month,
             'Context': context,
             'Combinations': combinations,
        })

        last_combination = None if len(combinations) == 0 else combinations[-1]
        self.mongo['ProjectFactorCombinationStatus'].update_one(
            {
                'ProjectID': project_id,
                'TargetMonth': target_month,
                'Context': context,
            },
            {
                '$set': { 'ProjectID': project_id, 'Context': context, 'TargetMonth': target_month, 'LastCombination': last_combination },
                '$inc': { 'CombinationCount': len(combinations) },
            },
            upsert = True
        )

