    def get_project_factor_combinations(self, project_id, target_month=None, context=None):

        query = { 'ProjectID': project_id }
        if target_month is not None:
            query['TargetMonth'] = target_month
        if context is not None:
            query['Context'] = context

        combinations = []
        for doc in self.mongo['ProjectFactorCombinations'].find(query).sort('Timestamp', pymongo.ASCENDING):
            for comb in doc['Combinations']:
                comb['TargetMonth'] = doc['TargetMonth']
                comb['Context'] = doc['Context']
            combinations += doc['Combinations']

        return combinations

