    def get_factor_strategies(self, strategy_ids=None):
        if strategy_ids is None:
            strategies = list(self.mongo['FactorStrategies'].find({}))
        else:
            strategy_lookup = { strategy['ID']: strategy for strategy in self.mongo['FactorStrategies'].find({ 'ID': { '$in': strategy_ids } }) }
            strategies = []
            for strategy_id in strategy_ids:
                strategy = strategy_lookup.get(strategy_id)
                if strategy is not None:
                    strategies.append(strategy)

        return strategies

